#include <vector>
using namespace std;

class Solution {
public:
    int findChampion(vector<vector<int>>& grid) {
        int n = grid.size();
        vector<int> isStronger(n, 1); // Initially, assume every team could be the champion

        for (int i = 0; i < n; ++i) {
            for (int j = 0; j < n; ++j) {
                if (grid[i][j] == 0) {
                    // If team i is not stronger than team j, then team i cannot be the champion
                    isStronger[i] = 0;
                    break;
                }
            }
        }

        // Find the team that is stronger than all others
        for (int i = 0; i < n; ++i) {
            if (isStronger[i]) {
                return i;
            }
        }

        return -1; // This line will never be reached due to problem constraints
    }
};
